import React, { Component } from 'react';
import './login.css'
class App extends Component {


   submitForm= (e) => {
      e.preventDefault()
  }

  render() {
    return (
         <div class="login-page">
        <div class="form registered ">
            <form  class="register-form">
                <input type="text" name="name" id="name" placeholder="user name"/>
                <input type="text" name="password" id="name" placeholder="password"/>
                <input type="email" name="name" id="name" placeholder="email id"/>
                <input type="button" value="Button" class="btn"/>
                <p class="msg" >Already Registere? <a href="#">Login</a></p>
            </form>
            <form action="" method="get" class="login-form">
                <input type="text" name="name" id="name" placeholder="user name"/>
                <input type="text" name="password" id="name" placeholder="password"/>
                <input type="button" value="LOGIN" class="btn"/>
                <p class="msg">Not Registered? <a href="#">Register</a></p>
            </form> 
        </div>
        </div>

    );
  }
}

export default App;
